$(document).on("click", ".add-mustachio", function() {
    let mustachioTokenIds = $("#mustachio-token-ids").val().split(",");
    let button = $(this);
    let tokenId = button.val();

    if(!mustachioTokenIds.includes(tokenId)) {
        mustachioTokenIds.push(tokenId);
    }

    let tokenIds = mustachioTokenIds.join(",");
    $("#mustachio-token-ids").val(tokenIds);

    button.removeClass("add-mustachio");
    button.addClass("remove-mustachio");

    button.removeClass("btn-custom-2");
    button.addClass("btn-custom-1");
    button.html('<i class="fas fa-minus"></i>');
});

$(document).on("click", ".remove-mustachio", function() {
    let mustachioTokenIds = $("#mustachio-token-ids").val().split(",");
    let button = $(this);
    let tokenId = button.val();

    if(mustachioTokenIds.includes(tokenId)) {
        let index = mustachioTokenIds.indexOf(tokenId);
        if (index !== -1) {
            mustachioTokenIds.splice(index, 1);
        }
    }

    let tokenIds = mustachioTokenIds.join(",");
    $("#mustachio-token-ids").val(tokenIds);

    button.removeClass("remove-mustachio");
    button.addClass("add-mustachio");

    button.removeClass("btn-custom-1");
    button.addClass("btn-custom-2");
    button.html('<i class="fas fa-plus"></i>');
});

$(document).on("click", ".view-token-properties", function() {
    let properties = $(this).data("properties");
    let content = ' <div class="d-flex justify-content-center mt-2 mb-3">';
    content +=          $(this).closest("tr").find(".token-name").html();
    content += '    </div>';

    for(let i = 0; i < properties.length; i++) {
        content += '    <div class="col-6 col-xl-4 p-2">';
        content += '        <div class="card bg-light h-100">';
        content += '            <div class="card-body h-100">';
        content += '                <div class="d-flex justify-content-center align-items-center h-100">';
        content += '                    <div class="text-center">';
        content += '                        <p class="neo-bold font-size-80 mb-1 text-uppercase text-decoration-none link-color-4">' + properties[i].trait_type + '</p>';
        content += '                        <div class="neo-bold font-size-100 text-color-6 mb-1">' + properties[i].value + '</div>';
        content += '                        <p class="font-size-80 text-color-7 mb-0">' + properties[i].percentage.toFixed(0) + '% have this trait</p>';
        content += '                    </div>';
        content += '                </div>';
        content += '            </div>';
        content += '        </div>';
        content += '    </div>';
    }

    $("#token-properties-container").html(content);
    $("#modal-token-properties").modal("show");
});

