// AMAC Registrant
$(document).on("click", ".approve-registrant-confirm", function() {
    $("#modal-warning .submit").attr("id", "approve-registrant");
    $("#modal-warning .submit").val($(this).val());
    $("#modal-warning").modal("show");
});

$(document).on("click", "#approve-registrant", function() {
    $("#modal-warning .submit").prop("disabled", true);

    let formData = new FormData();
    formData.append('id', $(this).val());
    formData.append('status', '1');

    $.ajax({
        url: 'https://ownly.market/amac-registrant-update-status',
        // url: 'http://ownly-api.test/amac-registrant-update-status',
        method: "POST",
        cache: false,
        contentType: false,
        processData: false,
        data: formData
    }).done(async function(response) {
        initializeReloadButton("");

        $("#modal-success .message").text("Confirmed");
        $("#modal-success").modal("show");
    }).fail(function(error) {
        console.log(error);
    }).always(function() {
        $("#modal-warning").modal("hide");
        $("#modal-warning .submit").prop("disabled", false);
    });
});

